import React from "react";
import "./SupportGroups.css"; // Optional: for styling

const supportGroups = [
  {
    name: "Nayi Disha Hyderabad 2",
    city: "Hyderabad",
    description:
      "Community of parents with children above 13 diagnosed with Autism, ADHD, Down Syndrome, Intellectual Disability, and Cerebral Palsy. English speaking group.",
  },
  {
    name: "Nayi Disha Bengaluru",
    city: "Bengaluru",
    description:
      "Community of parents with children above 13 diagnosed with Autism, ADHD, Down Syndrome, Intellectual Disability, and Cerebral Palsy. English speaking group.",
  },
  {
    name: "Nayi Disha Pune",
    city: "Pune",
    description:
      "Community of parents with children above 13 diagnosed with Autism, ADHD, Down Syndrome, Intellectual Disability, and Cerebral Palsy. English speaking group.",
  },
  {
    name: "Nayi Disha Down Syndrome",
    city: "Multi-city",
    description:
      "Community of parents with children diagnosed with Down Syndrome and other conditions like Autism, ADHD, Intellectual Disability, and Cerebral Palsy. English speaking group.",
  },
  {
    name: "Nayi Disha Cerebral Palsy",
    city: "Multi-city",
    description:
      "Community of parents with children diagnosed with Cerebral Palsy and other conditions like Autism, ADHD, Intellectual Disability, and Down Syndrome. English speaking group.",
  },
  {
    name: "Nayi Disha Mumbai",
    city: "Mumbai",
    description:
      "Community of parents with children above 13 diagnosed with Autism, ADHD, Down Syndrome, Intellectual Disability, and Cerebral Palsy. English speaking group.",
  },
];

export default function SupportGroups() {
  return (
    <div className="support-groups-container">
      <h1>Parent Support Groups</h1>
      <div className="groups-list">
        {supportGroups.map((group, index) => (
          <div key={index} className="group-card">
            <h2>{group.name}</h2>
            <p><strong>Location:</strong> {group.city}</p>
            <p>{group.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}
